import React from 'react';
import './main.css';

export default function Main(){

    return (
        <>
            <div className="container">
                <div className="row"></div>        
                    <div className="centering">
                        <div className="card card-signin my-5 spacing">
                            <div className="fb-profile">
                                <img align="left" className="fb-image-lg" src={require('../../assets/superficies.jpeg')} alt="Wallpaper"/>
                                <img align="left" className="fb-image-profile thumbnail proportion" src={require('../../assets/gabriela.jpeg')} alt="Gabriela Silva"/>
                                <div className="fb-profile-text">
                                    <h1>Gabriela Silva</h1>
                                    <p>Girls just wanna go fun.</p>
                                </div>
                            </div>
                        </div>
                    </div>
            </div>

        </> 

    );
}
